import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { MilitarListComponent } from './militar-list/militar-list.component';
import { CreateMilitarComponent } from './create-militar/create-militar.component';

const routes: Routes = [
   { path: 'militars', component: MilitarListComponent },
   { path: 'create-militar', component: CreateMilitarComponent },
   { path: '', redirectTo: 'militars', pathMatch: 'full'}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
